一、中国人民财产保险股份有限公司北京市分公司于本判决生效后七日内赔偿黄家勤交通费120元;
二、北京怡锦飞服装有限责任公司于本判决生效后七日内赔偿黄家勤医疗费4052.85元;
三、驳回黄家勤其他诉讼请求。
如果未按本判决指定的期间履行给付金钱义务，应当依照《中华人民共和国民事诉讼法》第二百五十三条之规定，加倍支付迟延履行期间的债务利息。
案件受理费50元，由黄家勤负担5元（已交纳）；由北京怡锦飞服装有限责任公司负担45元，于本判决生效后七日内交纳。
如不服本判决，可以在判决书送达之日起十五日内，向本院递交上诉状，并按对方当事人的人数或者代表人的人数提出副本，上诉于北京市第二中级人民法院
